import AdminDashboard from './pages/AdminDashboard';
import AdminLogin from './pages/AdminLogin';
import './App.css';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Flights from './pages/Flights';
import Login from './pages/Login';
import Register from './pages/Register';
import Hotels from './pages/Hotels'; // ðŸ†• Import Hotels Page
import UserBookings from './pages/UserBookings'; // Adjust the path if necessary

import { Container, Navbar, Nav } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <Router>
      <Navbar bg="primary" variant="dark" expand="lg">
        <Container>
          <Navbar.Brand as={Link} to="/">MakeMyTrip Clone</Navbar.Brand>
          <Nav className="ms-auto">
            <Nav.Link as={Link} to="/flights">Flights</Nav.Link>
            <Nav.Link as={Link} to="/hotels">Hotels</Nav.Link> {/* ðŸ†• */}
            <Nav.Link as={Link} to="/login">Login</Nav.Link>
            <Nav.Link as={Link} to="/register">Register</Nav.Link>
            <Nav.Link as={Link} to="/user-bookings">User Bookings</Nav.Link> {/* ðŸ†• */}
          </Nav>
        </Container>
      </Navbar>

      <Container className="my-4">
        <Routes>
          <Route path="/" element={<h1>Welcome to MakeMyTrip Clone</h1>} />
          <Route path="/flights" element={<Flights />} />
          <Route path="/hotels" element={<Hotels />} /> {/* ðŸ†• */}
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/user-bookings" element={<UserBookings />} />
          <Route path="/admin/login" element={<AdminLogin />} />
          <Route path="/admin/dashboard" element={<AdminDashboard />} />
          <Route path="/admin/flights" element={<ManageFlights />} />
          <Route path="/admin/hotels" element={<ManageHotels />} />


        </Routes>
      </Container>
    </Router>
  );
}

export default App;
